    it('should create the app', () => {
      expect(app).toBeTruthy();
    });

    it(`should have the 'Spec-tacular!' title`, () => {
      expect(app.title).toEqual('Spec-tacular!');
    });

    it('should render title', () => {
      const fixture = app;
    });
});
